sequoia = Image.create(title: "Sequoia", component: "Sequoia", svg_url: "/images/sequoia.svg", national_park: "Sequoia", year: "1890", location: "California", description: "Sequoia National Park is adjacent to Kings Canyon National Park in California's southern Sierra Nevada mountains. It's known for its huge sequoia trees, notably the General Sherman Tree dominating the Giant Forest. The underground Crystal Cave features streams and striking rock formations. Moro Rock is a granite dome offering sweeping park views. Nearby is the Tunnel Tree, a toppled tree cut to accommodate the road.")
yosemite = Image.create(title: "Yosemite", component: "Yosemite", svg_url: "/images/yosemite.svg", national_park: "Yosemite", year: "1890", location: "California", description: "Yosemite features sheer granite cliffs, exceptionally tall waterfalls, and old-growth forests at a unique intersection of geology and hydrology. Half Dome and El Capitan rise from the park's centerpiece, the glacier-carved Yosemite Valley, and from its vertical walls drop Yosemite Falls, one of North America's tallest waterfalls at 2,425 feet (739 m) high. Three giant sequoia groves, along with a pristine wilderness in the heart of the Sierra Nevada, are home to a wide variety of rare plant and animal species.")
arches = Image.create(title: "Arches", component: "Arches", svg_url: "/images/arches.svg", national_park: "Arches", year: "1929", location: "Utah", description: "This site features more than 2,000 natural sandstone arches, with some of the most popular arches in the park being Delicate Arch, Landscape Arch and Double Arch.[15] Millions of years of erosion have created these structures located in a desert climate where the arid ground has life-sustaining biological soil crusts and potholes that serve as natural water-collecting basins. Other geologic formations include stone pinnacles, fins, and balancing rocks.")
grandcanyon = Image.create(title: "Grand Canyon", component: "GrandCanyon", svg_url: "/images/grand-canyon.svg", national_park: "Grand Canyon", year: "1919", location: "Arizona", description: "The Grand Canyon, carved by the mighty Colorado River, is 277 miles (446 km) long, up to 1 mile (1.6 km) deep, and up to 15 miles (24 km) wide. Millions of years of erosion have exposed the multicolored layers of the Colorado Plateau in mesas and canyon walls, visible from both the north and south rims, or from a number of trails that descend into the canyon itself.")
zion = Image.create(title: "Zion", component: "Zion", svg_url: "/images/zion.svg", national_park: "Zion", year: "1919", location: "Utah", description: "Located at the junction of the Colorado Plateau, Great Basin, and Mojave Desert, this park contains sandstone features such as mesas, rock towers, and canyons, including the Virgin River Narrows. The various sandstone formations and the forks of the Virgin River create a wilderness divided into four ecosystems: desert, riparian, woodland, and coniferous forest.")
saguaro = Image.create(title: "Saguaro", component: "Saguaro", svg_url: "/images/saguaro.svg", national_park: "Saguaro", year: "1994", location: "Arizona", description: "Saguaro National Park is in southern Arizona. The park is named for the large saguaro cactus, native to its desert environment. In the western Tucson Mountain District, Signal Hill Trail leads to petroglyphs of the ancient Hohokam people. Split into the separate Rincon Mountain and Tucson Mountain districts, this park is evidence that the dry Sonoran Desert is still home to a great variety of life spanning six biotic communities. Beyond the namesake giant saguaro cacti, there are barrel cacti, chollas, and prickly pears, as well as lesser long-nosed bats, spotted owls, and javelinas.")
glacier = Image.create(title: "Glacier", component: "Glacier", svg_url: "/images/glacier-national.svg", national_park: "Glacier", year: "1910", location: "Montana", description: "Glacier National Park is a 1,583-sq.-mi. wilderness area in Montana's Rocky Mountains, with glacier-carved peaks and valleys running to the Canadian border. It's crossed by the mountainous Going-to-the-Sun Road. Among more than 700 miles of hiking trails, it has a route to photogenic Hidden Lake. The local mountains, formed by an overthrust, expose Paleozoic fossils including trilobites, mollusks, giant ferns and dinosaurs. Diverse wildlife ranges from mountain goats to grizzly bears.")
yosemite2 = Image.create(title: "Yosemite2", component: "Yosemite2", svg_url: "/images/yosemite2.svg", national_park: "Yosemite", year: "1890", location: "California", description: "Yosemite features sheer granite cliffs, exceptionally tall waterfalls, and old-growth forests at a unique intersection of geology and hydrology. Half Dome and El Capitan rise from the park's centerpiece, the glacier-carved Yosemite Valley, and from its vertical walls drop Yosemite Falls, one of North America's tallest waterfalls at 2,425 feet (739 m) high. Three giant sequoia groves, along with a pristine wilderness in the heart of the Sierra Nevada, are home to a wide variety of rare plant and animal species.")
grandteton = Image.create(title: "Grand Teton", component: "GrandTeton", svg_url: "/images/grand-teton.svg", national_park: "Grand Teton", year: "1929", location: "Wyoming", description: "Grand Teton National Park is in the northwest of the U.S state of Wyoming. It encompasses the Teton mountain range, the tallest being the 4,000-meter Grand Teton peak. The park's historic Jackson Hole and reflective piedmont lakes teem with endemic wildlife, with a backdrop of craggy mountains that rise abruptly from the sage-covered valley.")
canyonlands = Image.create(title: "Canyonlands", component: "Canyonlands", svg_url: "/images/canyonlands.svg", national_park: "Canyonlands", year: "1964", location: "Utah", description: "Canyonlands National Park in southeastern Utah is known for its dramatic desert landscape carved by the Colorado River. Island in the Sky is a huge, flat-topped mesa with panoramic overlooks. Other notable areas include the towering rock pinnacles known as the Needles, the remote canyons of the Maze and the Native American rock paintings in Horseshoe Canyon. Whitewater rapids flow through Cataract Canyon.")
everglades = Image.create(title: "Everglades", component: "Everglades", svg_url: "/images/everglades.svg", national_park: "Everglades", year: "1934", location: "Florida", description: "Everglades National Park is a 1.5-million-acre wetlands preserve on the southern tip of the U.S. state of Florida. Often compared to a grassy, slow-moving river, the Everglades is made up of coastal mangroves, sawgrass marshes and pine flatwoods that are home to hundreds of animal species. Among the Everglades' abundant wildlife are the endangered leatherback turtle, Florida panther and West Indian manatee.")
yellowstone = Image.create(title: "Yellowstone", component: "Yellowstone", svg_url: "/images/yellowstone.svg", national_park: "Yellowstone", year: "1872", location: "Wyoming, Montana, Idaho", description: "Yellowstone National Park is a nearly 3,500-sq.-mile wilderness recreation area atop a volcanic hot spot. Mostly in Wyoming, the park spreads into parts of Montana and Idaho too. Yellowstone features dramatic canyons, alpine rivers, lush forests, hot springs and gushing geysers, including its most famous, Old Faithful. It's also home to hundreds of animal species, including bears, wolves, bison, elk and antelope.")


